const WorkoutForm = () => {
    
    const handleForm = (e) => {
        e.preventDefault()
    }
    return ( 
        <div className="workout-form">
            <h4 className="mb-2">Add new workouts</h4>
            <form onSubmit={handleForm}>
                <label>Exersize Title:</label>
                <label>Reps:</label>
                <label>Load (in kg):</label>
            </form>
        </div>
     );
}
 
export default WorkoutForm;
